  true,\n\t\"url\": null,\n\t\"notes\": \"The National Household Education Survey
  Program, 2012 Early Childhood Program Participation Survey (ECPP-NHES:2012), is
  a study that is part of the National Household Education Survey (NHES) program.
  ECPP-NHES:2012 (http://nces.ed.gov/nhes/) is a cross-sectional survey that collects
  data directly from households on educational issues. This study was conducted using
  address based sample, self-administered questionnaires of households. Households
  in 2012 were sampled. Key statistics produced from ECPP-NHES:2012 are early childhood
  care and education.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
